window.bookSummaryJSON = "<p><b>A Soul Is a Terrible Thing to Waste! </b></p> <p>In the second book in the Dead Jack series, the zombie detective hits rock bottom, bingeing on fairy dust and formaldehyde 24/7. Reluctantly, he sets out with a fellow zombie, the narcissistic Garry, to find his long-lost soul. But a new threat emerges: a neo-Nazi group that hunts down the depressed corpse, believing his sidekick Oswald has the power to capture all the souls in Pandemonium. Again, the wicked world needs saving, but this time can Jack also save himself?</p>"; 
